import Shop from './Shop'
import Sell from './Sell'
import About from './About'
import Cart from './Cart'

function App() {
  return (
    <div>
     <Header />
     <Shop />
     <Sell/>
     <About />
     <Cart /> 
    </div>
  );
}

export default App;
